import React from "react";
import Navbar from "./components/Navbar";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <h1>Dashboard</h1>
        <Navbar />
      </BrowserRouter>
    </div>
  );
}

export default App;
